In Godot Engine 3.x, the equivalent to the KinematicBody node is the KinematicBody2D node for 2D physics and the KinematicBody node for 3D physics. For a first-person controller script, you typically use the KinematicBody node in 3D.

Here's a basic example of a first-person controller script in Godot Engine 3.x:

```gdscript
extends KinematicBody

export var speed = 10
export var gravity = -9.8
export var jump_speed = 10
export var mouse_sensitivity = 0.2

var velocity = Vector3.ZERO
var direction = Vector3.ZERO
var camera = null

func _ready():
    camera = get_node("Camera")

func _process(delta):
    direction = Vector3.ZERO
    if Input.is_action_pressed("move_forward"):
        direction -= transform.basis.z
    if Input.is_action_pressed("move_backward"):
        direction += transform.basis.z
    if Input.is_action_pressed("move_left"):
        direction -= transform.basis.x
    if Input.is_action_pressed("move_right"):
        direction += transform.basis.x
    direction = direction.normalized()

    var camera_x = Input.get_action_strength("move_right") - Input.get_action_strength("move_left")
    var camera_y = Input.get_action_strength("move_backward") - Input.get_action_strength("move_forward")
    camera.rotate_x(deg2rad(-camera_y * mouse_sensitivity))
    camera.rotation_degrees.x = clamp(camera.rotation_degrees.x, -89, 89)
    var camera_direction = Vector2(camera_x, camera_y).normalized()
    var camera_rotation = Quaternion(deg2rad(camera_direction.angle()), Vector3.UP)
    transform = transform.basis * camera_rotation

func _input(event):
    if event is InputEventMouseMotion and Input.get_mouse_mode() == Input.MOUSE_MODE_CAPTURED:
        camera.rotate_x(deg2rad(event.relative.y * mouse_sensitivity))
        camera.rotation_degrees.x = clamp(camera.rotation_degrees.x, -89, 89)
        var camera_direction = Vector2(event.relative.x, event.relative.y).normalized()
        var camera_rotation = Quaternion(deg2rad(camera_direction.angle()), Vector3.UP)
        transform = transform.basis * camera_rotation

func _physics_process(delta):
    velocity.y += delta * gravity
    if is_on_floor():
        if Input.is_action_just_pressed("jump"):
            velocity.y = jump_speed
    velocity = move_and_slide(velocity, Vector3.UP)
```

